from enum import Enum

class SubmissionStatus(Enum):
    PENDING = "Pending"
    PROCESSING = "Processing"
    COMPLETED = "Completed"
    FAILED = "Failed"

class ActionType(Enum):
    CREATE = "Create"
    UPDATE = "Update"
    DELETE = "Delete"

