class SubmissionDashboard:
    def __init__(self):
        self.submissions = {}

    def update_status_label(self, submission_id: str, status: SubmissionStatus) -> bool:
        if submission_id not in self.submissions:
            return False
        self.submissions[submission_id] = status
        return True

    def get_status(self, submission_id: str) -> Optional[SubmissionStatus]:
        return self.submissions.get(submission_id)

class DUNSValidator:
    def validate(self, duns: str, action_type: ActionType, registration_date: str) -> bool:
        if not duns or not duns.isdigit() or len(duns) != 9:
            return False
        try:
            reg_date = datetime.datetime.strptime(registration_date, "%Y-%m-%d")
            if action_type == ActionType.CREATE and reg_date < datetime.datetime.now():
                return True
            elif action_type in [ActionType.UPDATE, ActionType.DELETE]:
                return True
            return False
        except ValueError:
            return False

class ZIPValidator:
    def validate(self, zip_code: str) -> bool:
        pattern = r'^\d{5}(?:-\d{4})?$'
        return re.match(pattern, zip_code) is not None

