class FileProcessor:
    ALLOWED_EXTENSIONS = {'csv', 'xlsx', 'json'}

    def validate_extension(self, filename: str) -> bool:
        ext = filename.split('.')[-1].lower() if '.' in filename else ''
        return ext in self.ALLOWED_EXTENSIONS

    def process_upload(self, file_path: str) -> bool:
        if not os.path.exists(file_path):
            return False
        if not self.validate_extension(file_path):
            return False
        print(f"Processing file: {file_path}")
        return True

class SubmissionHandler:
    def __init__(self):
        self.locked_submissions = set()

    def is_locked(self, submission_id: str) -> bool:
        return submission_id in self.locked_submissions

    def lock_submission(self, submission_id: str) -> bool:
        if self.is_locked(submission_id):
            return False
        self.locked_submissions.add(submission_id)
        return True

    def unlock_submission(self, submission_id: str) -> bool:
        if not self.is_locked(submission_id):
            return False
        self.locked_submissions.remove(submission_id)
        return True

    def submit_data(self, data: dict) -> bool:
        submission_id = data.get("submission_id")
        if not submission_id or self.is_locked(submission_id):
            return False
        self.lock_submission(submission_id)
        print(f"Processing submission: {submission_id}")
        self.unlock_submission(submission_id)
        return True

