class UserStoryManager:
    def __init__(self):
        self.user_stories = []

    def load_stories(self, stories: List[Dict]) -> None:
        for story in stories:
            self.user_stories.append(
                UserStory(
                    title=story.get("title", ""),
                    description=story.get("description", ""),
                    cluster=story.get("cluster", "")
                )
            )

    def get_stories_by_cluster(self, cluster: str) -> List[UserStory]:
        return [story for story in self.user_stories if story.cluster == cluster]
